DROP TABLE IF EXISTS `tb_penelitian`;
CREATE TABLE `tb_penelitian` (
  `pen_id` int(11) NOT NULL AUTO_INCREMENT,
  `status_login` tinyint(1) NOT NULL DEFAULT '1',
  `ajar_id` int(11) DEFAULT NULL,
  `dosen_id` int(11) DEFAULT NULL COMMENT 'ketua tim peneliti',
  `topik_id` int(11) NOT NULL DEFAULT '1',
  `riset_id` int(11) NOT NULL,
  `pen_judul` varchar(200) DEFAULT NULL,
  `pen_deskripsi` text,
  `pen_tags` varchar(100) NOT NULL COMMENT 'kata kunci penelitian',
  `pen_peneliti` varchar(50) DEFAULT NULL COMMENT 'pakai koma',
  `pen_anggotaD3` int(11) NOT NULL DEFAULT '0',
  `pen_anggotaS1` int(11) NOT NULL DEFAULT '0',
  `pen_anggotaS2` int(11) NOT NULL DEFAULT '0',
  `pen_mulai` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `pen_tahun` int(11) NOT NULL,
  `pen_tahunke` int(11) NOT NULL,
  `pen_tingkat` tinyint(4) NOT NULL COMMENT 'tingkat 1,2,3',
  `pen_status` smallint(6) DEFAULT '0' COMMENT '0=usul;1=dikerjakan;2=selesai;3=ditolak;4=hapus',
  `pen_danaluar` varchar(50) DEFAULT NULL,
  `pen_mod` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `pen_kemajuan` tinyint(4) NOT NULL DEFAULT '0',
  `pen_anggaran` tinyint(4) NOT NULL DEFAULT '0',
  `pen_logbook` tinyint(4) NOT NULL DEFAULT '0',
  `pen_akhir` tinyint(4) NOT NULL DEFAULT '0',
  `pen_luaran` tinyint(4) NOT NULL DEFAULT '0',
  `pen_jadwalseminar` datetime NOT NULL,
  `pen_parent` int(11) DEFAULT NULL COMMENT 'id parent penelitian awal',
  PRIMARY KEY (`pen_id`),
  KEY `fk_relasi_penelitianajar` (`ajar_id`),
  KEY `fk_relasi_penelitiantopik` (`topik_id`),
  KEY `fk_relasi_userpenelitian` (`dosen_id`),
  KEY `pen_skim` (`pen_tingkat`),
  KEY `riset_id` (`riset_id`),
  KEY `pen_laporan` (`pen_kemajuan`,`pen_anggaran`,`pen_logbook`,`pen_luaran`),
  CONSTRAINT `fk_relasi_penelitianajar` FOREIGN KEY (`ajar_id`) REFERENCES `tb_ajar` (`ajar_id`),
  CONSTRAINT `fk_relasi_penelitiantopik` FOREIGN KEY (`topik_id`) REFERENCES `tb_topik` (`topik_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DELIMITER ;;

CREATE TRIGGER `ins_pen` AFTER INSERT ON `tb_penelitian` FOR EACH ROW
    NULL,
    NEW.pen_id,
    NEW.dosen_id,
    NEW.pen_mulai,
    NEW.pen_status
);;

CREATE TRIGGER `upd_pen` BEFORE UPDATE ON `tb_penelitian` FOR EACH ROW
IF NOT (NEW.pen_status <=> OLD.pen_status) THEN
        NULL,
        OLD.pen_id,
        OLD.dosen_id,
        now(),
        NEW.pen_status
    );
END IF;;

DELIMITER ;

